import FundoUm from './componentes/fundo1'
import Style from './App.css'
import fundo2 from './img/fundodois.png'
import fundo3 from './img/fundotres.png'
import fundo4 from './img/fundoquatro.png'
import fundo5 from './img/ultimo.png'


function App(){
  return(
    <body>
      <FundoUm/>
      <img className={Style.fundo2} src={fundo2}/>
      <img className={Style.fundo3} src={fundo3}/>
      <img className={Style.fundo4} src={fundo4}/>
      <img className={Style.fundo5} src={fundo5}/>
      </body>
  );
}
export default App;
